import React from "react";

import "./ConfirmForgetPasswordCard.css";

const ConfirmForgetPasswordCard = (props) => {
  return (
    <div className="ConfirmForgetPasswordCard">
      We have sent the update password link to your email, please check that!
    </div>
  );
};

export default ConfirmForgetPasswordCard;
